import anthropic
from PyPDF2 import PdfReader

#HIDING MY API FOR SECURITY REASONS
client = anthropic.Anthropic(api_key="#")

def read_pdf(file):
    reader = PdfReader(file)
    content = ''
    for page in range(len(reader.pages)):
        content += reader.pages[page].extract_text()
    return content

# Upload the resume PDF file
resume_file = None
from google.colab import files
uploaded = files.upload()

for filename in uploaded.keys():
    resume_file = filename
    break

# Read the PDF content
with open(resume_file, 'rb') as file:
    resume_text = read_pdf(file)

message = client.messages.create(
    model="claude-3-opus-20240229",
    max_tokens=1000,
    temperature=0,
    system="Parse all key-details of the following resume as 5-6 pointers \nand top skills of resume in short pointer \n(KEEP IT CRISP ONLY SUPER IMPORTANT DETAIL) dont fetch all details\n\nand give it a rating on scale of 100 in end if he is suitable for job \n\ngive me details like this\nNAME:\nROLE:\nTOP SKILLS:\nPAST EXPERIENCE:\nCERTIFICATION:\n\nRATING:",
    messages=[
        {
            "role": "user",
            "content": resume_text
        }
    ]
)

print(message.content[0].text)

